import "./App.css";
import Menu from "./components/Menu";
import ProductContainer from "./components/ProductContainer";

const products = [
  {id: 1, image: ['img/test_image.jpg', 'img/test_image_2.jpg', 'img/test_image.jpg', 'img/test_image_2.jpg'], price: 18000, stock: 10},
  {id: 2, image: ['img/test_image.jpg', 'img/test_image_2.jpg', 'img/test_image.jpg', 'img/test_image_2.jpg'], price: 20000, stock: 5},
  {id: 3, image: ['img/test_image.jpg', 'img/test_image_2.jpg', 'img/test_image.jpg', 'img/test_image_2.jpg'], price: 130000, stock: 4},
  {id: 4, image: ['img/test_image.jpg', 'img/test_image_2.jpg', 'img/test_image.jpg', 'img/test_image_2.jpg'], price: 9000, stock: 12},
  {id: 5, image: ['img/test_image.jpg', 'img/test_image_2.jpg', 'img/test_image.jpg', 'img/test_image_2.jpg'], price: 3700, stock: 40},
  {id: 6, image: ['img/test_image.jpg', 'img/test_image_2.jpg', 'img/test_image.jpg', 'img/test_image_2.jpg'], price: 186500, stock: 13}
];

export default function App() {
  return (
    <>
      <Menu products = {products} />
      <ProductContainer products={products}/>
    </>
  );
}
